import React from 'react';
import { Container, Row } from 'react-bootstrap';
import './Family.css';

function Family()
{
    return (
        <div className="Family">
            <Container fluid>
                <Row className="Family-main">
                    <h1>Future place for Little Souls family</h1>
                </Row>
            </Container>
        </div>
    );
}

export default Family;
